import React from 'react';
import './App.css';
// import { Machinebox }  from './components/Machinebox';
import Machinebox from './components/Machinebox';


// const animal = [
//   {
//     name: 'Lion',
//     scientificName: 'Panthero leo',
//     size: 140,
//     diet: ['meat'],
//   },
//   {
//     name: 'Gorilla',
//     scientificName: 'Gorilla beringei',
//     size: 205,
//     diet: ['plants', 'insects'],
//     additional: {
//       notes: 'This is the eastern gorilla. There is also a western gorilla that is a different species.'
//     }
//   },
//   {
//     name: 'Zebra',
//     scientificName: 'Equus quagga',
//     size: 322,
//     diet: ['plants'],
//     additional: {
//       notes: 'There are three different species of zebra.',
//       link: 'https://en.wikipedia.org/wiki/Zebra'
//     }
//   }
// ]

const data = [
  { column0: "Producto 1",   column1: "A1", column2: "A2", column3: "A3", column4: "A4" , column5: "A5", column6: "A6", column7: "A7", column8: "A8" , column9: "A9"},
  { column0: "Producto 2",   column1: "B1", column2: "B2", column3: "B3", column4: "B4" , column5: "B5", column6: "B6", column7: "B7", column8: "B8" , column9: "B9"},
  { column0: "Producto 3",   column1: "C1", column2: "C2", column3: "C3", column4: "C4" , column5: "C5", column6: "C6", column7: "C7", column8: "C8" , column9: "C9"},
  { column0: "Producto 4",   column1: "D1", column2: "D2", column3: "D3", column4: "D4" , column5: "D5", column6: "D6", column7: "D7", column8: "D8" , column9: "D9"},
  { column0: "Producto 5",   column1: "E1", column2: "E2", column3: "E3", column4: "E4" , column5: "E5", column6: "E6", column7: "E7", column8: "E8" , column9: "E9"}
]

function App() {
  return (
    <div className="App">
      <h1> Maquinator </h1>
      <table>
        <tr>         
          <th>Datos</th>
          <th><img src={require('./img/electrodos/1.png')} alt="Logo" /> </th>
          <th><img src={require('./img/electrodos/2.png')} alt="Logo" /> </th>
          <th><img src={require('./img/electrodos/3.png')} alt="Logo" /> </th>
          <th><img src={require('./img/electrodos/4.png')} alt="Logo" /> </th>
          <th><img src={require('./img/electrodos/5.png')} alt="Logo" /> </th>
          <th><img src={require('./img/electrodos/6.png')} alt="Logo" /> </th>
          <th><img src={require('./img/electrodos/7.png')} alt="Logo" /> </th>
          <th><img src={require('./img/electrodos/8.png')} alt="Logo" /> </th>
          <th><img src={require('./img/electrodos/9.png')} alt="Logo" /> </th>
        </tr>
        <tr>
          <td>
            <p> Estoy aqui</p>
          </td>
          <td>
            <Machinebox ruta_variable ={"foto_3.png"}/>

          </td>
        </tr>
        {data.map((val, key) => {
          return ( 
            <tr key={key}>
              <td>{val.column0} </td>
              <td>{val.column1}</td>
              <td>{val.column2}</td>
              <td>{val.column3}</td>
              <td>{val.column4}</td>
              <td>{val.column5}</td>
              <td>{val.column6}</td>
              <td>{val.column7}</td>
              <td>{val.column8}</td>
              <td>{val.column9}</td>
            </tr>

          )
        })}
      </table> 
        <h1>Zona de pruebas</h1>
        <Machinebox

        />
    </div>
  );
}

export default App;
